function resetShip(ship){
  if (ship != null && ship.type != 101){
    let gems; 
    if (ship.crystals >= 20) gems = 20; else gems = ship.crystals; 
    ship.set({type:101,shield:999,invulnerable:360,crystals:gems});
  }  
}

